void mainImage( out vec4 O, in vec2 fragCoord )
{
    vec2 uv = fragCoord/iResolution.xy,
    f = (uv - 0.5) * 1.5;
    f.x *= iResolution.x/iResolution.y;
    float angle = atan(f.x,f.y),
     t = iTime * .3,
     d = length(f) - t; 
    float r = sin(d*3.);  
    float c = smoothstep(r-.1, r+.1, sin(t*3.+angle*5.0));
    O = vec4(c);
}
